import React from 'react';
import '../styles/eventcard.css';

const EventCard = ({ title, date, location }) => {
  return (
    <div className="event-card">
      <h3>{title}</h3>
      <p>{date}</p>
      <p>{location}</p>
    </div>
  );
};

export default EventCard;
